import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Navbar from "../Navbar";
import Footer from "../Footer";



const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: "white",
    padding: "2vw",
  },
  title: {
      //margin: "35vh 5vw",
      fontSize: "min(7vw, 60px)",
      color: "#0a0a0a",
      margin: "0",
      padding: "0",
  },
  tagline: {
    fontSize: "min(7vw, 60px)",
    color: "#0a0a0a",
    fontWeight: "300",
  },
  description: {
    fontSize: "min(4vw, 25px)",
    color: "#0a0a0a",
    fontWeight: "400",
  },
  pic1: {
    maxWidth: "100%",
    height: "auto",
    position: "relative",
    display: "block",
    padding: "2vh",
    paddingTop: "5vh",
    paddingBottom: "5vh",

  },
  pic1Container: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  empty: {
    height: "80vh",
  },

}));

export default function Template(props) {
    const classes = useStyles();
    const {project, title, tagline, description} = props;

  return (
    <div>
        <Navbar />
        <div className={classes.root}>
          <div className={classes.pic1Container}>
            <img 
              src={`static/projects/${project}/pic1.png`}
              alt="project" 
              className={classes.pic1}
            />
          </div>

          <div className={classes.title}>{title}</div>
          <div className={classes.tagline}>{tagline}</div>
          <div className={classes.description}>{description}</div>
          <div className={classes.empty}></div>
        </div>
        <Footer/>
    </div>
  );
}
